import React from 'react';

import './thankyou_page.styles.scss';

export default function ThankyouPage(props) {
    return (
        <div class="jumbotron text-center">
            <h1 class="display-3">Thank You!</h1>
            <p class="lead">Your message has been sent. I will get back to you shortly.</p>
            <hr />
            <p class="lead">
                <a class="btn btn-primary btn-sm" href="/#home" role="button">Continue to homepage</a>
            </p>
        </div>
    )
}
